// TransactionsList.js
import React from "react";

function TransactionsList({ transactions }) {
  return (
    <div>
      <h3>Transactions</h3>
      <ul>
        {transactions.map((transaction) => (
          <li key={transaction.id}>{transaction.description}</li>
        ))}
      </ul>
    </div>
  );
}

export default TransactionsList;
